void get_input::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_depth\" :  \"" << s_depth.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_re_address0\" :  \"" << fft_hdata_re_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_re_ce0\" :  \"" << fft_hdata_re_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_re_we0\" :  \"" << fft_hdata_re_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_re_d0\" :  \"" << fft_hdata_re_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"fft_hdata_re_q0\" :  \"" << fft_hdata_re_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_im_address0\" :  \"" << fft_hdata_im_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_im_ce0\" :  \"" << fft_hdata_im_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_im_we0\" :  \"" << fft_hdata_im_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"fft_hdata_im_d0\" :  \"" << fft_hdata_im_d0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"in_data_address0\" :  \"" << in_data_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"in_data_ce0\" :  \"" << in_data_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"in_data_q0\" :  \"" << in_data_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"in_linesize_address0\" :  \"" << in_linesize_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"in_linesize_ce0\" :  \"" << in_linesize_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"in_linesize_q0\" :  \"" << in_linesize_q0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"w\" :  \"" << w.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"h\" :  \"" << h.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"n\" :  \"" << n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"plane\" :  \"" << plane.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"scale\" :  \"" << scale.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

